import { LayoutView, ExceptionView, UserView } from '@/components/layouts'

export const routerMap = [
  {
    path: '/',
    name: 'LayoutView',
    component: LayoutView,
    redirect: '/permission',
    children: [
      // 客户管理
      {
        path: '/permission',
        name: 'permission',
        component: () => import('./views/permission/Permission.vue')
      },
      {
        path: '/crm/cust',
        name: 'customer',
        component: () => import('./views/customer/Customer.vue'),
        meta: { breads: ['客户关系管理', '客户'] }
      },
      // 商城
      {
        path: '/mall/cashier',
        name: 'cashier',
        component: () => import('./views/mall/Cashier.vue'),
        meta: { breads: ['商城', '基础设置', '支付方式'] }
      },
      {
        path: '/mall/delivery',
        name: 'technologyManage',
        component: () => import('./views/mall/Delivery.vue'),
        meta: { breads: ['商城', '基础设置', '配送方式'] }
      },
      // 产品管理
      {
        path: '/pdm/category',
        name: 'gathering',
        component: () => import('./views/product/category/Category.vue'),
        meta: { breads: ['产品管理', '产品管理', '产品分类'] }
      },
      {
        path: '/pdm/catattr',
        name: 'payment',
        component: () => import('./views/product/catattr/Catattr.vue'),
        meta: { breads: ['产品管理', '产品管理', '属性分类'] }
      },
      {
        path: '/pdm/goods',
        name: 'refund',
        component: () => import('./views/product/goods/Goods.vue'),
        meta: { breads: ['产品管理', '产品管理', '产品列表'] }
      },
      {
        path: '/sale/order',
        name: 'order',
        component: () => import('./views/sale/orderList/Order.vue'),
        meta: { breads: ['销售列表', '产品列表'] }
      }
    ]
  },
  // user
  {
    path: '/userview',
    name: 'userview',
    component: UserView,
    redirect: '/user/login',
    children: [
      {
        path: '/user/login',
        name: 'login',
        component: () => import('@/views/user/Login.vue')
      },
      {
        path: '/user/register',
        name: 'register',
        component: () => import('@/views/user/Register.vue')

      },
      {
        path: '/user/retrieve',
        name: 'retrieve',
        component: () => import('@/views/user/Retrieve.vue')
      }
    ]
  },
  // Exception
  {
    path: '/exceptionview',
    name: 'exceptionview',
    component: ExceptionView,
    redirect: '/exception/403',
    children: [
      {
        path: '/exception/403',
        name: 'Exception403',
        component: () => import('@/views/exception/403.vue')
      },
      {
        path: '/exception/404',
        name: 'Exception404',
        component: () => import('@/views/exception/404.vue')

      },
      {
        path: '/exception/500',
        name: 'Exception500',
        component: () => import('@/views/exception/500.vue')
      },
      {
        path: '/exception/browser',
        name: 'ExceptionBrowser',
        component: () => import('@/views/exception/Browser.vue')
      }
    ]
  },
  {
    path: '*',
    redirect: '/404'
  }
]
